// import React, { useEffect } from 'react';
import {useNavigate} from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowLeft } from "@fortawesome/free-solid-svg-icons";
import {} from "@fortawesome/free-regular-svg-icons";



function Footer() {

    const navigate = useNavigate();



    return (
        <div>
            <footer>

                <div class="footerContainer">

                    {/* SOCIAL MEDIA ICONS */}
                    <div class="footerSocialMedia">

                        <ul>
                            <li class="footerLabel">SOCIAL MEDIA</li>

                            {/* Facebook  */}
                            <li ><FontAwesomeIcon className="footerList-item" icon={"fa-brands fa-facebook-f"}></FontAwesomeIcon></li>

                            {/* Twitter */}
                            <li ><FontAwesomeIcon className="footerList-item" icon={faArrowLeft}></FontAwesomeIcon></li>

                            {/* Instagram */}
                            <li ><FontAwesomeIcon className="footerList-item" icon={faArrowLeft}></FontAwesomeIcon></li>

                            {/* Amazon */}
                            <li ><FontAwesomeIcon className="footerList-item" icon={faArrowLeft}></FontAwesomeIcon></li>
                        </ul>

                    </div>

                    {/* PAGE WARPS */}
                    <div class="footerPageWarps">

                        <ul>
                            <li class="footerLabel">PAGE WARPS</li>

                            <li className="footerList-item" onClick={() => navigate("/")}>home</li>
                            <li className="footerList-item" onClick={() => navigate("/Products")}>products</li>
                            <li className="footerList-item" onClick={() => navigate("/Contact")}>contact</li>
                        </ul>

                    </div>

                    {/* ADDITIONAL CONTENT */}
                    <div class="footerAdditionalContent">

                        <ul>
                            <li class="footerLabel">ADDITIONAL CONTENT</li>

                            <li ><a className="footerList-item">PDFs and Manuals</a></li>
                            <li ><a className="footerList-item">Tech Support</a></li>
                            <li ><a className="footerList-item">FAQ</a></li>
                        </ul>

                    </div>

                </div>

            </footer>
        </div>
    )
}

export default Footer
